import TextBar from "../../components/TextBar";
import MainMenu from "../../components/MainMenu"
import {useSelector} from "react-redux"
import "./AddUser.css"
import Form from 'react-bootstrap/Form';

function AddUser(){

    const userLogin = useSelector((state) => state.userLogin);
    const { userInfo } = userLogin;

    return(
    <>
        <MainMenu uInfo={userInfo}></MainMenu>
        <TextBar text={"Add User"} subText={"Create a new user by filling in the appropriate data"}></TextBar>
        <div className="row">
            <div className="col-4"></div>
                <div className="col-2 pt-5">
                    <form id="form-user">
                        <h2 id="text-user">Create User</h2>
                        <div className="form-group" id="control">
                            <div class="form-floating mt-3">
                                <label class="col-form-label" id="lb" for="inputDefault">Default input</label>
                                <input type="text" class="form-control" placeholder="Default input" id="inputDefault"></input>
                            </div>
                        </div>
                    </form>
                    <div className="col-4"></div>
                </div>
            </div>
          
    </>
       
    )}

export default AddUser;
